              <i className="fab fa-reddit fa-2x class-pd class-nav-fnt"></i>
            
              </ul>
          </div>
        </div>
      </div>
      <div className='footer-copyright'>
        <div className='container class-ct class-nav-fnt'>Copyright Â© 2019 Web Design And Code by Vt Emaily</div>
      </div>
    </footer>
    </div>
  );
  }
};

